import './Header.css';
import {Link} from 'react-router-dom';

function Header() {
    return (
        <div className='f4 pa2 bg-black white center'>
            <h1>TodoList</h1>

            {/* Home and About */}
            <div
                style={{
                    display: "flex",
                    justifyContent: "center"
                }}
                className='w-50 ma2 pa5 b--solid bg-light-yellow'>
                <Link to=''>Home </Link> |
                <Link to='/about'> About</Link>
            </div>

        </div>
    )
}

export default Header
